import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useAuth0 } from "@auth0/auth0-react";
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';

function Map() {

  const [data, setData] = useState([]);
  const [markers, setMarkers] = useState([]);

  useEffect(() => {
    axios.get('https://api.lgbusiness.net/api/v1/events/')
      .then(response => {
        setData(response.data.instances);
        setMarkers(response.data.instances.map(instance => ({
          lat: instance.latitude,
          lng: instance.longitude,
          name: instance.name
        })));
      });
  }, []);

return (
  <>
  <MapContainer center={[-33.455275555427804	, -70.6605295633026]} zoom={10} style={{ height: '100px', width: '100px'}}>
      <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" 
       attribution='Map data &copy; <a href="https://www.openstreetmap.org/">OpenStreetMap</a> contributors'/>
      {markers.map(marker => (
        <Marker key={marker.name} position={[marker.lat, marker.lng]}>
          <Popup>{marker.name}</Popup>
        </Marker>
      ))}
    </MapContainer>
  </>
)



}

export default Map;
